style.css:
@-moz-document domain('youtube.com') {

.ytp-play-progress
  {
    background: #1ee5ea! important;
  }

  .ytp-load-progress
  {
    background: #FFD9DF! important;
  }

  .ytp-scrubber-button
  {
    background: url("https://24.media.tumblr.com/3e1960a35a3fe4a63e001eb230c2b828/tumblr_mrc7i8Lugs1svxdcvo1_1280.gif")! important;
    background-repeat: no-repeat! important;
    width: 800px! important;
    height: 600px! important;
    margin-left: -328px! important;
    margin-top: -290px! important;
    transform: scale(0.30)! important;
  }
  .ytp-right-controls.style-scope.ytd-player,
.ytp-left-controls.style-scope.ytd-player{
	z-index:999!important;
}
#ytp-id-18{
z-index: 99999!important;
}
}
